Our babymoon in the Hamptons was everything we wanted and more. We relaxed by the pool, explored each town, walked along the beach and ate quite a few lobster rolls. What more could you ask for?! A few of you asked for some recommendations in the Hamptons and I’m working on a blog post. In the meantime here were some of our favorite spots:

@bakerhouse1650 - We LOVED staying here in East Hampton
@wolfferwine - Try Cory’s favorite Summer in a Bottle rosé or my favorite non-alcohol Spring in a Bottle rosé
@lulukitchenandbar - Great dinner spot in Sag Harbor
@bostwicks_on_the_harbor - They don’t take reservations, but trust me it’s worth the wait.
@fresno_restaurant - We loved sitting outside for dinner here
@1770house - Grab a drink in the tavern or make a reservation for dinner and sit outside
@montaukbrewco - Cory enjoyed their beer 🍺 
@theclambar - Fun spot for lunch with amazing seafood options
@mobysny - Family friendly restaurant with great drinks and food
@amberwavesfarm - Farm stand with yummy salads and fresh produce

#ad Cory and I can’t wait to travel with Marlowe next year! We have a few trips planned and we’re looking forward to using @slumberpod. SlumberPod is a portable blackout canopy that fits over pack n’ play, placard, travel cots and inflatable mattresses. The blackout fabric is breathable and also includes pouches for a video monitor and fan.

It’s the perfect thing to have while traveling especially when room-sharing. It’s also great that it fits in a carry-on suitcase and it’s easy to assemble. SlumberPod offers free shipping and a 90 day warranty which is so nice! I’ve linked this product in my LTK Shop so you can go shop directly from there. https://liketk.it/4pjWe

